      // 用户注册成功后，你可以直接在这里获取他的用户信息
      console.log(userInfo);
    });
    this.guard.on('scanned-success', (userInfo) => {
      // 用户扫码登录成功后，你可以直接在这里获取他的用户信息
      console.log(userInfo);
    });
  }
}

